members.doc:
The action provider will expect the data input to be according to the input schema
The schema is described according to JSON Schema standard: https://json-schema.org/

Our schema supports additional custom properties:
1. "full_payload": Boolean - When true, the entire payload available will be delivered in the
InvokeRequest.action_params object under the name of the property.
When set to true, the type of the property must be an 'object'.

Example (1) - Send Email Action input schema:
{
"$schema": "https://json-schema.org/draft/2020-12/schema",
"type": "object",
"title": "Send email input schema",
"description": "The schema of the json that is sent when invoking this send email action",
"default": {},
"examples": [
{
"to": "contact@email.com",
"subject": "Registration Confirmed",
"body": "Hi John, you are confirmed for the event",
"payload": {
"formName": "Event Form Registration",
"city": "Tel Aviv, Israel",
"date": "2022-02-22T20:22:22.000Z"
}
}
],
"required": [
"to",
"subject",
"body",
"payload",
],
"properties": {
"to": {
"$id": "#/properties/to",
"type": "string",
"format": "email",
"title": "To Email",
"description": "The email to send the email to",
"default": "",
"examples": [
"contact@email.com"
]
},
"subject": {
"$id": "#/properties/subject",
"type": "string",
"title": "Subject",
"description": "The subject of the email sent",
"default": "",
"examples": [
"Registration Confirmed"
]
},
"body": {
"$id": "#/properties/body",
"type": "string",
"title": "Body",
"description": "The body of the email",
"default": "",
"examples": [
"Hi, you are confirmed for the event"
]
}
"payload": {
"$id": "#/properties/payload",
"type": "object",
"full_payload": true,
"examples": [
{
"formName": "Event Form Registration",
"city": "Tel Aviv, Israel",
"date": "2022-02-22T20:22:22.000Z"
}
]
}
}
}

------------------------------------------------------------------

Example (2) - Add Label to Contact Action input schema:
{
"$schema": "https://json-schema.org/draft/2020-12/schema",
"type": "object",
"title": "Add label to contact input schema",
"description": "The schema of the json that is sent when invoking this add label to contact action",
"default": {},
"examples": [
{
"contactId": "a647eb32-c5f4-11ec-9d64-0242ac120002",
"labelId": "1e8b5e5e-dba2-11ec-9d64-0242ac120002"
}
],
"required": [
"contactId",
"labelId"
],
"properties": {
"contactId": {
"$id": "#/properties/contactId",
"type": "string",
"format": "uuid",
"title": "Contact Id",
"description": "The Id of the contact to apply the label to",
"default": "",
"identityType": "contact" // can be contact/visitor/user, limited to 1 type per identity.
},
"labelId": {
"$id": "#/properties/labelId",
"type": "string",
"format": "uuid",
"title": "Label Id",
"description": "The Id of label to apply",
"default": "",
}
}
}

The action provider commits to response according to the output schema
The schema is described according to JSON Schema standard: https://json-schema.org/

Example of Send Email Action output schema:
{
"$schema": "https://json-schema.org/draft/2020-12/schema",
"type": "object",
"title": "Send email output schema",
"description": "The schema of the json we expect to receive in the result of this action",
"default": {},
"examples": [
{
"didSend": false,
"didBounce": true,
"bounceReason": "Email address does not exist"
}
],
"required": [
"didSend",
"didBounce"
],
"properties": {
"didSend": {
"$id": "#/properties/didSend",
"type": "boolean",
"title": "Did Send",
"description": "Did we send the email?",
"default": false,
"examples": [
false
]
},
"didBounce": {
"$id": "#/properties/didBounce",
"type": "boolean",
"title": "Did Bounce",
"description": "Did this email bounce?",
"default": false,
"examples": [
true
]
},
"bounceReason": {
"$id": "#/properties/bounceReason",
"type": "string",
"title": "Bounce Reason",
"description": "The reason this email bounced",
"default": "",
"examples": [
"Email address does not exist"
]
}
}
}

The trigger configuration

example of a trigger:

{
appId: "56cc7843-fdfc-417f-a660-d4af9a2eafe3",
triggerKey: "form_submit",
displayName: "Visitor submits a form",
payloadDataSchema: {
"$schema": "http://json-schema.org/draft-07/schema",
"type": "object",
"title": "Visitor submits a form Payload Schema",
"description": "The schema of the payload that is part of the triggered event",
"default": {},
"examples": [
{
"formId": "60d2cd50-1047-4164-884d-8c24fbda84bb",
"formName": "My Cool Form
}
],
"properties": {
"formId": {
"$id": "#/properties/formId",
"type": "string",
"format": "uuid",
"title": "Form ID",
"description": "The form identifier",
"default": "",
"examples": [
"60d2cd50-1047-4164-884d-8c24fbda84bb"
]
},
"formName": {
"$id": "#/properties/formName",
"type": "string",
"title": "Form Name",
"description": "The form display name",
"default": "",
"examples": [
"My Form"
]
},
"contactId": {
"$id": "#/properties/contactId",
"type": "string",
"format": "uuid",
"title": "Contact Id",
"description": "The Id of the contact which submitted the form",
"default": "",
"identityType": "contact", // can be contact, visitor, user limited to 1 type per identity,
"name": "contact" // friendly name to be used later on, in order to user that person's data "contact.firstName"
}
},
"required": [
"formId",
"formName",
"contactId"
],
"additionalProperties": false
}
}

input mapping expression for the action inputs
for example:
`{  "subject": "Thanks for reaching out!"
   "message": "Hi {{contact.name.first}}, thanks for contacting our business"
 }`
 where the value for "contact.name.first" comes from the trigger's payload

